import React from 'react';
import ImgSenai from '../../assets/images/Logo_SENAI_PRINCIPAL_VERMELHO.png'
import '../../global.css';
import '../header/style.css';

function Header() {
  return (
    <div>
      <nav>
        <div id="header">
          <img id="icone" src={ImgSenai} alt="" />
        </div>

          <div id="loucura">

            <div id="teste">

            </div>
            <div id="myDIV">

            </div>
          </div>

      </nav>

    </div>
  );
}

export default Header;
